import React, { useState, useEffect, useRef, createRef, setState } from "react"
import { Button, View, Text, StyleSheet, ImageBackground, Image, FlatList } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import AsyncStorage from '@react-native-async-storage/async-storage'
import Axios from 'axios'


const url = "http://127.0.0.1:3000";

const Item = ({ name, time, date}) => (
  <View style={styles.item}>
    <Text style={{fontSize:32}}>{name}  {time}  {date}</Text>
  </View>
);

const renderItem = ({ item }) => (
  <Item name={item.name} time={item.time} date={item.createdAt}/>
);


function HighScoresScreen() {

  const [data, setData] = useState("");

  const FlatListItemSeparator = () => {
    return (
      <View
        style={{
          height: 1,
          width: "100%",
          backgroundColor: "#000",
        }}
      />
    );
  }

  const getData = () => {
    try {
      Axios.get('http://127.0.0.1:3000/myscores')
      .then((response) => {
        setData(response.data);
        console.log(response.data);
        //alert(data[0]);
        //console.log(response.data[0]);
        //alert(response.data[0].age);
      });
    } catch(e) {
      console.log("error in getData ")
      console.dir(e)
      // error reading value
    }
  }

  const getMyData = (name) => {
    try {
      Axios.get('http://127.0.0.1:3000/myscores')
      .then((response) => {
        setData(response.data);
        console.log(response.data);
        //alert(data[0]);
        //console.log(response.data[0]);
        //alert(response.data[0].age);
      });
    } catch(e) {
      console.log("error in getData ")
      console.dir(e)
      // error reading value
    }
  }

  useEffect(() => {
    //clearAll();
    getData()
  },[])


  return (


    <View style={styles.container}>
      <View style={{flexDirection: 'row'}}>
      <Button color="green" 
        title="Local" 
        onPress={() => {
          //setIsInput(true);
        }}>
      </Button>
      <Button color="blue" 
        title="Global" 
        onPress={() => {
          //setIsInput(true);
        }}>
      </Button>
      </View>
        <FlatList
            data={data}
            renderItem={renderItem}
            ItemSeparatorComponent={FlatListItemSeparator}
        />
    </View>
  );
}

export default HighScoresScreen;

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center'
  },
  item: {
    //backgroundColor: 'grey',
    padding: 20,
    marginVertical: 8,
    marginHorizontal: 16,
  }
});
